import React, { PureComponent } from 'react'
import { styled } from 'styletron-react'
import styles from './styles'

const DropdownItemContainer = styled(styles.dropdownItemContainer)
const DropdownItemContent = styled(styles.dropdownItemContent)
const DropdownItemIcon = styled(styles.dropdownItemIcon)

class DropdownItem extends PureComponent {
  render() {
    const { Icon, themeNumber, ...rest } = this.props
    console.log('TCL: DropdownItem -> render -> themeNumber', themeNumber)

    return (
      <DropdownItemContainer $themeNumber={themeNumber} {...rest}>
        {Icon ? <DropdownItemIcon $as={Icon} /> : null}
        <DropdownItemContent>{this.props.children}</DropdownItemContent>
      </DropdownItemContainer>
    )
  }
}

export default DropdownItem
